def item_data(name,rank,category,desc,buff,debuff):
    try:
        if name!='-' and rank!='-' and category!='-':
            fout=open('Files/temp.csv', 'w', newline='')
            fw=csv.writer(fout)
            rec=[name,rank,category,desc,buff,debuff]
            fw.writerow(rec)
            fout.close()

            subprocess.Popen(['python', 'Item Data/build/gui.py'])

            window.quit()
    except:
        print()

def name_cut(name):
    if len(name)>15:
        s=''
        for k in range(15):
            s+=name[k]
        s+='...'
        return s
    else:
        return name

